import React from "react";

const SingleSearchResult = (props) => {
  return (
    <div className="px-32  w-full border-2 border-black pl-0 ml-3 mr-3 flex flex-row justify-around items-baseline">
      <h1 className="font-thin">{props.firstName}</h1>
      <h1 className="font-thin">{props.lastName}</h1>
      <h1 className="font-thin">{props.email}</h1>
      <h1 className="font-thin">{props.course}</h1>
    </div>
  );
};

export default SingleSearchResult;
